      <div className="card">
    <div class="blog-text">
      <Link to="/My First Semester at Waterloo CS">

          <h1 class="blog-title">My First Semester at Waterloo CS</h1>


          <div class="col-lg-5">

            <p>
              Lorem Ipsum is simply dummy text of the printing and typesetting
